import logo from './logo.svg';
import './App.css';


function App(){
  return(
    <div className ="App">
      <Welcome Name ="Neo" />
    </div>
  )
}

function Welcome(props){
  return(
    <section>
      <h1>
        Hello,<span>(props.name)</span>
      </h1>
      </section>
  );
}
export default Welcome;
